import { Link } from "react-router-dom";

const list = {
  'ectenias': 'Ectenias',
  // 'antyfonaI': 'Antyfona I',
}

export const Liturgy = () => {
  return (
    <>
      <ul className="library">
        <li className="library__element">
          <Link to="ectenias" className="itemLink">
            Ectenias
          </Link>
        </li>
        {list.map(key => {
          <li className="library__element">
            <Link to="ectenias" className="itemLink">
              {list.key}
            </Link>
          </li>
        })}
      </ul>
    </>
  )
}
